import React from "react";

const NotFound = () => {
  return (
    <div className="site">
    <div className="sketch">
      <div className="bee-sketch red"></div>
      <div className="bee-sketch blue"></div>
    </div>
  
  <h1 className="h1">404:
    <small className="small">OOPS ! ARE YOU LOST ?</small></h1>
  </div>
  );
};

export default NotFound;
